package com.demo;

public class Table {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int num;
		for(int i=2;i<=10;i++) {
			for(int j=1;j<=10;j++) {
				
				num=j*i;
				System.out.println(num);
			}
				
				System.out.print(" ");
		}
		
		
		
	}

}
